import React, { useEffect } from 'react';
import { useFormik } from 'formik';
import * as Yup from 'yup';
import { Button, Card, Col, Form, Row } from 'react-bootstrap';
import toast from 'react-hot-toast';

import { TranslatableText } from '../../components/translations';
import { useCobrarTasaMutation } from '../../redux/apis/terminales';
import { useHistory } from 'react-router-dom';
import { Routes } from '../../routes';
import { Section, SectionBody, SectionHeader, SectionTitle } from '../../components/section';
import { useEmpleadosRepresentantesQuery as useGetRepresentantesItemsQuery} from '../../redux/apis/users';
import { useCategoriaQuery as useGetCategoriaItemsQuery} from '../../redux/apis/categorias';

export default ({ id }) => {
  const [cobrarTasa, { isSuccess: isCobrarTasaSuccess, data: cobrarTasaData, isError: isCobrarTasaError, error: cobrarTasaError }] = useCobrarTasaMutation();
  const { data: { data: empleados = [] } = {} } = useGetRepresentantesItemsQuery({Eliminado: false});
  const { data: { data: categorias = [] } = {} } = useGetCategoriaItemsQuery({EstadoId: 1});
  const history = useHistory();

  const formik = useFormik({
    enableReinitialize: true,
    initialValues: {
      EmpleadoId: { id: 0 },
      CategoriaId: {id: 0},
      Motivo: '',
    },
    validationSchema: Yup.object().shape({
        EmpleadoId: Yup.object().shape({
        id: Yup.number().integer().notOneOf([0], '').required( '')
      }),
    }),
    onSubmit: (values) => {
      cobrarTasa(values);
    }
  });

  useEffect(() => {
    if (isCobrarTasaSuccess) {
      toast.success(cobrarTasaData.message);
      formik.resetForm();
      history.push(Routes.Dashboard.path);
      
    }
  }, [isCobrarTasaSuccess, cobrarTasaData]);

  useEffect(() => {
    if (isCobrarTasaError) {
      formik.setErrors(cobrarTasaError.data);

      const errors = [].concat(...Object.values(cobrarTasaError.data)).join('\n');
      toast.error(errors);
    }
  }, [isCobrarTasaError, cobrarTasaError]);

  return (
    <Form onSubmit={formik.handleSubmit}>
      <Section>
        <SectionHeader className="d-flex align-items-center">
          <SectionTitle className="flex-fill">
            <TranslatableText  entry="Votar" />
          </SectionTitle>
          <Button type="submit" className="ms-2">
            <TranslatableText  entry="Votar" />
          </Button>
        </SectionHeader>
        <SectionBody>
          <Row>
            <Col sm={12} lg={6}>
              <Form.Group className="mb-3">
                <Form.Label>
                  <TranslatableText  entry="CategorÃ­a" />*
                </Form.Label>
                <Form.Select {...formik.getFieldProps('CategoriaId.id')} isInvalid={!!formik.errors.CategoriaId?.id}>
                  <option value="0"></option>
                  {categorias.map((categoria) => (<option key={categoria.id} value={`${categoria.Id}`}>{categoria.Nombre}</option>))}
                </Form.Select>
                <Form.Control.Feedback type="invalid">{formik.errors.CategoriaId?.id}</Form.Control.Feedback>
              </Form.Group>
            </Col>
            <Col sm={12} lg={6}>
            <Form.Group className="mb-3">
                <Form.Label>
                  <TranslatableText  entry="Empleado" />*
                </Form.Label>
                <Form.Select {...formik.getFieldProps('EmpleadoId.id')} isInvalid={!!formik.errors.EmpleadoId?.id}>
                  <option value="0"></option>
                  {empleados.map((Empleado) => (<option key={Empleado.id} value={`${Empleado.Id}`}>{Empleado.Descripcion}</option>))}
                </Form.Select>
                <Form.Control.Feedback type="invalid">{formik.errors.EmpleadoId?.id}</Form.Control.Feedback>
              </Form.Group>
            </Col>
          </Row>
          <Row>
          <Col sm={12} md={12}>
            <Form.Group className="mb-3">
              <Form.Label>
                <TranslatableText  entry="Motivo" />*
              </Form.Label>
              <Form.Control type="text"  {...formik.getFieldProps('Motivo')} isInvalid={!!formik.errors.Motivo && formik.touched.Motivo} />
              <Form.Control.Feedback type="invalid">{formik.errors.Motivo}</Form.Control.Feedback>
            </Form.Group>
          </Col>
          </Row>
    
        </SectionBody>
      </Section>
    </Form>
  );
};
